INSERT INTO `content` (`id`, `title`, `text`, `subTitle`, `languageId`, `active`, `created`, `createdById`, `updated`, `updatedById`) VALUES(4, 'About Us', '<p><span style="font-family: book antiqua,palatino;"><span style="font-size: large;">Managed by a team of expertise with over 10 years of experience in this industry, ARG has built its profile from nothing to well over thousand happy investors ever since its establishment in Oct 2008. </span></span></p>\r\n<p><span style="font-family: book antiqua,palatino;"><span style="font-size: large;">A team that believes in customer orientated, ARG offers what is suitable investment portfolio for their customer. These services include investment strategies, market research, overseas investment and funding management. </span></span></p>\r\n<p><span style="font-family: book antiqua,palatino;"><span style="font-size: large;">ARG has been actively promoting the importance of investment for their customers'' retirement planning through seminars and workshop.</span></span></p>', '', 1, 0, '2010-04-16 03:13:18', 1, '2010-04-30 11:50:38', 1);
INSERT INTO `content` (`id`, `title`, `text`, `subTitle`, `languageId`, `active`, `created`, `createdById`, `updated`, `updatedById`) VALUES(5, 'Services', '<p>Managed by a team of expertise with over 10 years of experience in this  industry, ARG has built its profile from nothing to well over thousand  happy investors ever since its establishment in Oct 2008.  A team that believes in customer orientated, ARG offers what is suitable  investment portfolio for their customer. These services include  investment strategies, market research, overseas investment and funding  management.  ARG has been actively promoting the importance of investment for their  customersï¿½ retirement planning through seminars and workshop.</p>', '', 1, 1, '2010-04-16 22:44:42', 1, '2010-04-27 21:11:47', 1);
INSERT INTO `content` (`id`, `title`, `text`, `subTitle`, `languageId`, `active`, `created`, `createdById`, `updated`, `updatedById`) VALUES(6, 'New Projects on the way', '<p>Managed by a team of expertise with over 10 years of experience in this industry, ARG has built its profile from nothing to well over thousand happy investors ever since its establishment in Oct 2008. A team that believes in customer orientated, ARG offers what is suitable investment portfolio for their customer. These services include investment strategies, market research, overseas investment and funding management. ARG has been actively promoting the importance of investment for their customersï¿½ retirement planning through seminars and workshop.</p>', '', 1, 1, '2010-04-16 23:11:25', 1, '2010-04-30 11:51:56', 1);
INSERT INTO `content` (`id`, `title`, `text`, `subTitle`, `languageId`, `active`, `created`, `createdById`, `updated`, `updatedById`) VALUES(7, 'Privacy Policy', '<p><span style="font-size: small;"><span style="font-family: verdana,geneva;"><strong>At ARG, we understand that privacy is an important issue for users  of (visitors to) the ARG Property Internet site www.argproperty.com.au and its related  domains. The following information is designed to help visitors understand what  information we collect from our site, and how we handle and use the information  after that. </strong></span></span></p>\r\n<p><span style="font-family: verdana,geneva;"><br /></span></p>\r\n<h3><span style="font-family: verdana,geneva;"><span style="font-size: large;">Information collection and use</span></span></h3>\r\n<p><span style="font-size: small;"><span style="font-family: verdana,geneva;">ARG is the sole owner of any information collected on this site. We will  not sell, share, or rent this information to others in ways different from what  is disclosed in this statement. ARG may collect information from our users  at several different points on our website. ARG may also transfer the  information collected to any relevant unit within ARG, and located anywhere  in the world. </span></span></p>\r\n<h3><span style="font-family: verdana,geneva;"><span style="font-size: large;">General inquiries</span></span></h3>\r\n<p><span style="font-size: small;"><span style="font-family: verdana,geneva;">If a user contacts ARG with a general inquiry, the user may need to  provide ARG with personal information (for example contact details). ARG will use this personal information to respond to the inquiry and track  further correspondence. Information is also used to compile statistics on  response handling, etc. This is done in aggregate, and no individual names or  other personal information are retained. Personal information collected is not  used for any other purpose. </span></span></p>\r\n<h3><span style="font-family: verdana,geneva;"><span style="font-size: large;">Cookies</span></span></h3>\r\n<p><span style="font-size: small;"><span style="font-family: verdana,geneva;">Cookies are small text files that a site transfers to a user''s (visitor''s)  hard disk or browser for added functionality or for tracking site usage. In  order to measure the effectiveness of our online presence, ARG may use  cookies to determine the path users take on our site and to identify repeat  users of our site. We do not use cookies to gather personal information such as  a person''s name or e-mail address.</span></span></p>\r\n<p><span style="font-size: small;"><span style="font-family: verdana,geneva;">Cookies can be saved to the hard disk, but so-called session cookies are  saved to the browser only and disappear when the browser is closed. On the ARGProperty.com.au homepage (and similar top or index pages), we use cookies that are  saved to the hard disk and therefore remain after the browser is closed. Such  cookies determine the path users take on our site and also identify repeat users  of our site, although not by names or email addresses. On other pages of our  site, we use session cookies to determine the path users take on our site. On  some pages, we may also use non-session cookies.</span></span></p>\r\n<p><span style="font-size: small;"><span style="font-family: verdana,geneva;">It is possible to configure your browser to reject cookies by modifying the  browser settings or preferences. If you wish to do so, we recommend you consult  the information provided in the browser or contact the browser vendor for help  and instructions.</span></span></p>\r\n<p><span style="font-size: small;"><span style="font-family: verdana,geneva;">Any information gathered by the use of cookies is compiled on an aggregate,  anonymous basis. </span></span></p>\r\n<h3><span style="font-family: verdana,geneva;"><span style="font-size: large;">Subscriptions </span></span></h3>\r\n<p><span style="font-size: small;"><span style="font-family: verdana,geneva;">If a user wishes to subscribe to ARG information such as press releases  or financial reports, we ask for an email address. ARG will use this e-mail  address only to send the requested information; we will not send other  unsolicited information.</span></span></p>\r\n<p><span style="font-size: small;"><span style="font-family: verdana,geneva;">How to subscribe and unsubscribe: Users may open or cancel subscription(s) at  any time by filling in the "newsletter" section with a preferred email address accessible from almost every page on this site.</span></span></p>\r\n<h3><span style="font-size: small;"><span style="font-family: verdana,geneva;">External links</span></span></h3>\r\n<p><span style="font-size: small;"><span style="font-family: verdana,geneva;">This site may contain links to other sites. Please take note that ARG is  not responsible for the privacy policies or practices of such other sites. We  encourage our users to be aware when they leave our site and to read the privacy  statements of each and every site that collects personally identifiable  information. This privacy statement applies solely to information collected by  this site. </span></span></p>\r\n<h3><span style="font-family: verdana,geneva;"><span style="font-size: large;">Changes to ARG''s Internet privacy policy</span></span></h3>\r\n<p><span style="font-size: small;"><span style="font-family: verdana,geneva;">ARG may, from time to time, make changes to this policy. We recommend  that users of this site re-visit this privacy policy on occasion to learn of new  privacy practices or changes to our policy. </span></span></p>\r\n<h3><span style="font-family: verdana,geneva;"><span style="font-size: large;">How to contact ARG about this privacy policy</span></span></h3>\r\n<p><span style="font-size: small;"><span style="font-family: verdana,geneva;">It''s important to us at ARG to hear what users have to say about our  services, and our policies. If site users have any questions, concerns, or  complaints about this privacy policy, or want to let us know what they think  about any of our products and services, they can use our online form accessible from the "Contact Us" tab or by filling in the form on <a href="../../../contactus.html">http://www.argproperty.com.au/contactus.html</a>.</span></span></p>', '', 1, 1, '2010-04-18 00:47:55', 1, '2010-06-01 18:22:57', 1);
