INSERT INTO `content` (`id`, `title`, `text`, `subTitle`, `languageId`, `active`, `created`, `createdById`, `updated`, `updatedById`) VALUES(22, 'Customer says', '<p>Managed by a team of expertise with over 10 years of experience in this  industry, ARG has built its profile from nothing to well over thousand  happy investors ever since its establishment in Oct 2008. A team that  believes in customer orientated, ARG offers what is suitable investment  portfolio for their customer. These services include investment  strategies, market research, overseas investment and funding management.  ARG has been actively promoting the importance of investment for their  customers'' retirement planning through seminars and workshop.</p>', '', 1, 1, '2010-04-30 20:07:52', 1, '2010-04-30 20:08:29', 1);
